import ExpenseItem from './components/ExpenseItem/ExpenseItem';
import Expenses from './components/Expenses/Expenses';

function App() {

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem 
      title = {expenses[0].title}
      amount = {expenses[0].amount}
      date={expenses[0].date}>
      </ExpenseItem>

    </div>
  );
}

export default App;
